window.bookSummaryJSON = "<p>Nathaniel Moon is the reluctant messiah.&nbsp;</p> <p>He has powers that define the word miraculous. But when he used those powers to help others, he brought about a world of trouble.</p> <p>Now Nathaniel lives a life of quiet obscurity, performing anonymous miracles. But, his anonymity has to end, because evil is coming to Middle Falls, Oregon, and threatens the people Nathaniel loves most.</p> <p>It's going to take a reluctant messiah to put things right.</p> <p><i>Includes a special bonus note read by the author.</i></p>"; 
